import React from 'react';
import { useState, useEffect } from 'react';


const Roster = (props) => {

    // Need a state?
    // const [dogSom, setDogSom] = useState([props]);
    // return (<p>fuck</p>);

    // If I don't check data even exists, there's an error and the page won't even render.
    // Console.log tells me the first "dogData" is undefined. Idk what that's about.
    if (props.dogData ) {
        console.log(props.dogData);
        return (
            <div className = "dog-container">
                {/* Can make this nicer later.. */}
                <p className= "dog-id"> 
                    <p>{props.dogData.name}</p> <p></p>#{props.dogData.id}</p>

                {/* <p className= "dog-id">Name: {props.dogData.name} ID: #{props.dogData.id}</p> */}
                <img style={{ width: "22vh"}} src={props.dogData.imageUrl}></img>

                <div className= "dog-options">
                    <button >Details! </button>
                    <div className="dog-details">Details!</div>

                    <button >Delete </button>
                    <div className="dog-delete">Delete this dog!</div>
                </div>
            </div>

        )
    }

}
export default Roster;
